Update OkHttpClient to use a custom HTTP client
=============================================

In this commit, we update the `httpClient` field to use a custom instance of `OkHttpClient`. This change allows us to modify the behavior of the HTTP client and add additional functionality. The updated code is as follows:
```diff
-  private OkHttpClient httpClient = new OkHttpClient();
+  private OkHttpClient httpClient;

  public MinioClient() {
    this(null, null);
  }

  public MinioClient(String endpoint, String accessKey) {
    this(endpoint, accessKey, null);
  }

+  public void setCustomHttpClient(OkHttpClient httpClient) {
+    this.httpClient = httpClient;
+  }
```
This commit modifies the `MinioClient` constructor to allow for customization of the HTTP client used for making requests. The updated code also includes a new method, `setCustomHttpClient`, that allows users to set their own custom HTTP client instance. This change makes it easier for users to modify the behavior of the HTTP client and add additional functionality as needed.

